import React from 'react';
import axios from "axios";

class ArchivePage extends React.Component{
    constructor(){
        this.state = {
            archives,
        };
    }

    componentDidMount() {
        axios("/listarchives").then(({ data }) => {
            this.setState({
                archives: data
            });
        });
    }


    render() {
        return(
            <div>
                <H1>{archives[0].id}</H1>
            </div>
        )
    };
};
